# SealedSecret for influxdb-auth in monitoring namespace
---
apiVersion: bitnami.com/v1alpha1
kind: SealedSecret
metadata:
  name: influxdb-auth
  namespace: monitoring
spec:
  encryptedData:
    admin-user-password: 
    admin-user-token: 
    user-password: 
  template:
    metadata:
      labels:
        app.kubernetes.io/name: influxdb
      name: influxdb-auth
      namespace: monitoring
    type: Opaque
---
apiVersion: bitnami.com/v1alpha1
kind: SealedSecret
metadata:
  name: nut-config
  namespace: monitoring
spec:
  encryptedData:
    ups.conf: 
    upsd.conf: 
    upsd.users: 
    upsmon.conf: 
  template:
    metadata:
      name: nut-config
      namespace: monitoring
    type: Opaque
